function expenseDate(props){
 const month= props.expense.dat.toLocaleString('en-GB', { month: 'long' })
 const day= props.expense.date.toLocaleString('en-GB', { year: 'numeric'})
 const year = props.expense.date.toLocaleString('en-GB', { day: 'numeric' })
 return(
    <div>
    <div>{month}</div>
    <div>{day}</div>
    <div>{year}</div>
   </div>
 );
}

export default expenseDate;
